import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import style from "../NavBar/NavBar.module.css"
import { useNavigate } from 'react-router-dom';
import brainly4 from '../../Assets/brainly4.jpg';

const FormNavBar = () => {
  const navigate = useNavigate();
  const [showMenu, setShowMenu] = useState(false);

  const handleShowUsers = () => {
    navigate('/users');
  }

  const handleShowDoctors = () => {
    navigate('/doctors');
  }

  const toggleMenu = (event) => {
    // event.stopPropagation();
    setShowMenu(!showMenu);
  }

  return (
    <nav className={style.navbar}>

      <div className={style.container}>

     <Link to='/home'>
      <img src={brainly4} className={style.brain}  width='100px' height='100px'/>
      </Link>
    
    <Link to="/about" className={style.about}>About</Link>

        <div className={style.dropdownContainer}>
        <button type='button' className={style.premium} onClick={(e) => {toggleMenu(); e.stopPropagation()}}>
         Nuestros usuarios
        </button>
          
          {showMenu && (
            <ul className={style.dropdownMenu}>
              <li className={style.users} onClick={handleShowUsers}>Pacientes</li>
              <li className={style.doctors} onClick={handleShowDoctors}>Doctores</li>
            </ul>
          )}
        </div>

       
            <button to={'/home'} className={style.premium} > Volver </button>
       

       <button className={style.premium} >Se Premium‚≠ê</button>
      
      </div>

      

    </nav>
  )
}

export default FormNavBar;
